import React, { Component } from "react";
import NavBar from "./components/navbar";
import "./App.css";

class App extends Component {
  state = {
    apiResponse: "",
    username: null,
  };

  constructor(props) {
    super(props);
    console.log("App - Constructor");
  }

  connecToServer() {  fetch('/');  }

  componentDidMount() {
    
    fetch('/data')
      .then((data) => this.setState({ username: data[0]}));
  }

  render() {
    const { username } = this.state;
    console.log("App - Rendered");
    return (
      <React.Fragment>  
        <NavBar />
        <button>Go to next title</button>
        <h2>{username ? `${username}` : "Hello World"}</h2>
      </React.Fragment>
    );
  }
}

export default App;
